import React from 'react';
import img from '../assets/home-bg.jpeg';


function Home() {

  return (
    <div className="relative">
      <img src={img} alt="home bg logo" className="w-auto h-auto opacity-80 md:hidden mx-auto" />
          <div className="absolute bottom-0 left-0 w-auto flex items-center h-auto justify-center">
              <h1 className="flex text-8xl font-thin mx-auto font-mono animate-bounce">Welcome</h1>
          </div>
    </div>
  );
}

export default Home;
